import React, { Component } from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  height: 200px;
  width: 400px;
  border-radius: 50px;
  border: 1px solid #aaa;
  padding: 10px;
`;
const LeftPart = styled.div`
  width: 150px;
  height: 100%;
  border-right: 2px dotted #eee;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const ImageContainer = styled.div`
  height: 120px;
  width: 120px;
  border-radius: 60px;
  background: red;
`;

const RightPart = styled.div`
  width: 250px;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

const NameContainer = styled.div`
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
  > p {
    font-size: 16px;
    font-weight: bolder;
    color: #000;
    margin-bottom: 0px;
  }
`;

const EmailContainer = styled.div`
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
  > p {
    font-size: 14px;
    color: #777;
    margin-bottom: 0px;
  }
`;

class Card extends Component {
  render() {
    return (
      <Wrapper>
        <LeftPart>
          <ImageContainer></ImageContainer>
        </LeftPart>
        <RightPart>
          <NameContainer>
            <p>Roshan Kumar</p>
          </NameContainer>
          <EmailContainer>
            <p>roshan.rk0204@gmail.com</p>
          </EmailContainer>
        </RightPart>
      </Wrapper>
    );
  }
}

export default Card;
